                    { 399, "", "", "4 gouttes", "Lamiaceae", "Flacon", "", null, "", "Voie orale réservée à l’adulte. Ne pas utiliser pure par voie orale, mais sur un support neutre. RECOMMANDATIONS : Ne pas dépasser la dose journalière recommandée. Tenir hors de portée des jeunes enfants. Ne se substitue pas à un régime alimentaire équilibré et varié, et à un mode de vie sain. Déconseillé chez les femmes enceintes et allaitantes, les enfants, les personnes âgées et les personnes souffrant de pathologies chroniques. Prendre attache auprès d'un professionnel de santé. Ne pas utiliser plus de 14 jours consécutifs. Éviter tout contact avec les yeux. RESTRICTIONS : Demandez conseil à un professionnel de santé en cas d'obstruction des voies biliaires (calculs), de reflux gastro-oesophagien, ou de troubles hépato-pancréatique. Déconseillé en cas d'antécédents d'épilepsie, d'antécédents de convulsions ou d'antécédent de pathologies neurologiques. Pas d'utilisation prolongée.", "1 à 2 gouttes 2 fois par jour (soit 36 à 72 mg 2 fois par jour).", "Menthe poivrée", "", "Essence (parties aériennes)", "Mentha x piperita L.", "Adolescents (moins de 18 ans),Allaitement,Autre (à préciser),Enfants (moins de 12 ans),Enfants en bas âge (1 à 3 ans),Grossesse,Nourrissons (moins de 1 an),Utilisation prolongée,Enfants (de moins de 6 ans),Enfants (de moins de 10 ans)", "MICRO EQUILIBRE" },
