                    { 478, "", "Collagène hydrolysé,Hyaluronate de sodium,Mélange de tocophérols,Lipase", "1 stick par jour", "", "Bâton / batônnet / stick", "", null, "", "Ne pas consommer une quantité journalière de 3-gallate d'épigallocatéchine (EGCG) supérieure ou égale à 800 mg. Ne doit pas être consommé si vous prenez le même jour d'autres produits contenant du thé vert. Ne doit pas être consommé à jeun. Contient de la caféine (79.9 mg/dose), ne doit pas être consommé par les femmes enceintes ou allaitantes et par les enfants de moins de 18 ans. Demandez l'avis d'un médecin en cas de traitement médicamenteux, de maladies du foie ou de la vésicule biliaire. Déconseillé en cas d'ulcère gastro-duodénal, d'obstruction biliaire, de troubles cardiaques, ou d'hyperthyroïdie. Déconseillé chez les personnes sous anticoagulant, anticancéreux et immunosuppresseurs, et aux personnes présentant des altérations de la fonction hépato-biliaire ou des calculs biliaires. Ne pas utiliser pendant des périodes prolongées sans consulter un médecin. Hommes de 55 ans et plus : une supplémentation incontrôlée en vitamine E peut augmenter le risque de cancer de la prostate.", "Diluer un stick par jour dans un verre d'eau 200 ml.", "MyBodySlim", "Autre (à préciser),Minceur / Brûleur,Peau", "", "Camellia sinensis (L.) Kuntze,Centella asiatica (L.) Urb.,Cucumis melo L.,Curcuma longa L.,Malpighia glabra L.,Paullinia cupana Kunth", "Adolescents (moins de 18 ans),Allaitement,Autre (à préciser),Enfants (moins de 12 ans),Enfants en bas âge (1 à 3 ans),Grossesse,Nourrissons (moins de 1 an),Problèmes cardiaques,Problèmes de foie,Sous traitement médicamenteux,Ulcère (estomac ou duodenum),Utilisation prolongée", "MYPURESKIN" },
