                    { 854, "", "", "[\"de 0,5 à 2 ml\", \"de 0,5 à 2 ml\"]", "", "[\"Flacon\", \"Flacon\"]", "", null, "[\"VYPHYTO\", \"VYPHYTO\"]", "[\"Bien agiter avant emploi. Avant 1 an : prendre 0,5 ml par jour, après le dîner.De 1 an à 5 ans : prendre 1 à 2 ml par jour, après le dîner.Après 5 ans : prendre 2 mL  par jour, après le dîner. Ce produit peut être pris pur ou dilué dans un verre d’eau ou une autre boisson. Il peut également convenir à l’adulte de plus de 15 ans. À conserver hors de la portée des enfants, à l'abri de la chaleur et de l’humidité. Il est recommandé de ne pas dépasser le dosage conseillé. A consommer de préférence avant la date indiquée sur l’emballage. Après ouverture, bien refermer le récipient, le conserver au réfrigérateur et consommer dans les 30 jours après ouverture.Ce complément alimentaire n’est pas un médicament et ne peut se substituer à une alimentation variée, équilibrée et à un mode de vie sain.\", \"Bien agiter avant emploi. Avant 1 an : prendre 0,5 ml par jour, après le dîner.De 1 an à 5 ans : prendre 1 à 2 ml par jour, après le dîner.Après 5 ans : prendre 2 mL  par jour, après le dîner. Ce produit peut être pris pur ou dilué dans un verre d’eau ou une autre boisson. Il peut également convenir à l’adulte de plus de 15 ans. À conserver hors de la portée des enfants, à l'abri de la chaleur et de l’humidité. Il est recommandé de ne pas dépasser le dosage conseillé. A consommer de préférence avant la date indiquée sur l’emballage. Après ouverture, bien refermer le récipient, le conserver au réfrigérateur et consommer dans les 30 jours après ouverture.Ce complément alimentaire n’est pas un médicament et ne peut se substituer à une alimentation variée, équilibrée et à un mode de vie sain.\"]", "[\"prendre 0,5 ou 1 ou 2 ml par jour en fonction de l'age, après le dîner\", \"prendre 0,5 ou 1 ou 2 ml par jour en fonction de l'age, après le dîner\"]", "[\"VYPHYTOKID DHA drop\", \"VYPHYTOKID DHA drop\"]", "Artères et cholestérol,Cro